import '../css/mascot.css';
import mascot from '../image/mascot.png';
import wind from '../image/wind.png'
import cloud from '../image/cloud.png'

function Mascot() {
  return (
    <div className="Mascot">
      <div className ="cloud5">
      <img src={cloud} width="700px"/>
      </div>
      <div className="props">
      <img src={mascot} width='400pt' className="nongtofu" />
      <p className="invite">" แล้วมากินเจด้วยกันนะฮะ&nbsp;^3^ "</p></div>
      <div className ="cloud6">
      <img src={cloud} width="700px"/>
      </div>
    </div>
  );
}

export default Mascot;
